import React from 'react';

function OrderCard(props) {
    return (
        <Card
        elevation={5}
        className={classes.parent}
        sx={{ maxWidth: 345 }}
        style={{ marginRight: 20, maxHeight: 400 }}
      >
        <CardHeader
          avatar={
            <>
              <Avatar
                src={Storage + post.photo}
                sx={{ bgcolor: red[500] }}
                alt={Storage + `avatar.png`}
                aria-label="recipe"
              ></Avatar>
              {post.name} {post.lastname}
            </>
          }
          action={
            <IconButton aria-label="settings">
              <a href={`https://api.whatsapp.com/send?phone=+${post.phone}`} target="_blank" >
              <WhatsAppIcon />

              </a>
            </IconButton>
          }
          title={post.title}
          subheader={post.date_depart}
        />

        <CardContent>
          <Typography variant="body2" color="text.secondary">
            <tr
              style={{
                textAlign: "center",
                fontSize: "15px",
                fontFamily: "system-ui",
              }}
            >

              <td style={{ whiteSpace: "nowrap", overflow: "hidden" }}>
              {countries[post.from_country].name}
              <br />

                <img
                  loading="lazy"
                  width="40"
                  src={`https://flagcdn.com/w40/${post.from_country.toLowerCase()}.png`}
                  srcSet={`https://flagcdn.com/w40/${post.from_country.toLowerCase()}.png 2x`}
                  alt=""
                />
              </td>

              <td
                style={{
                  whiteSpace: "nowrap",
                  overflow: "hidden",
                  textOverflow: "ellipsis",
                }}
              >
                {countries[post.to_country].name}
                <br />

                <img
                  loading="lazy"
                  width="40"
                  src={`https://flagcdn.com/w40/${post.to_country.toLowerCase()}.png`}
                  srcSet={`https://flagcdn.com/w40/${post.to_country.toLowerCase()}.png 2x`}
                  alt=""
                />


              </td>
            </tr>
            <br />

            <td style={{ display: "grid" }}>
              <TextField
                size="small"
                id="outlined-number"
                label="Order Weight"
                type="number"
                defaultValue="1"
                autoComplete="off"
                InputLabelProps={{
                  shrink: true,
                }}
                onChange={(e) => setwheight(e.target.value)}
                onInput={(e) => {
                  e.target.value = Math.max(0, parseInt(e.target.value))
                    .toString()
                    .slice(0, 2);
                }}
              />
              <br />
              <TextField
                size="small"
                id="outlined-number"
                label="Order Description"
                type="text"
                defaultValue={description}
                multiline
                InputLabelProps={{
                  shrink: true,
                }}
                onChange={(e) => setdescription(e.target.value)}
              />

              <br />
              <Button
                onClick={(id) => neworder(post.post_id)}
                variant="contained"
                color="primary"
                startIcon={<SendIcon />}
              >
                order
              </Button>

            </td>
          </Typography>
        </CardContent>
      </Card>
    );
}

export default OrderCard;
